const filters = [
	{
		name: 'cms',
		filter: [
			{
				type: 'input-number',
				field: 'Revenue',
			},
			{
				type: 'select',
				field: 'Something',
				options: [
					{
						value: '1',
						name: '1',
					},
				],
			},
			{
				type: 'input-date',
				field: 'From date',
			},
			{
				type: 'input-date',
				field: 'To date',
			},
		],
	},
	{
		name: 'salary',
		filter: [
			{
				type: 'input-number',
				field: 'Revenue',
			},
			{
				type: 'select',
				field: 'Something',
				options: [
					{
						value: '1',
						name: '1',
					},
				],
			},
			{
				type: 'input-date',
				field: 'From date',
			},
			{
				type: 'input-date',
				field: 'To date',
			},
		],
	},
];

export default filters;
